ขอความช่วยเหลือนำสุนัขจรจัดออกจากพื้นที่ บริเวณริมถนนที่รกร้าง ตรงข้ามกับสถานีบริการน้ำมันบางจาก ถนนบรมราชชนนี 70 แขวงศาลาธรรมสพน์ เขตทวีวัฒนา กรุงเทพมหานคร จุดสังเกตอยู่ระหว่างป้ายหยุดรถโดยสารประจำทาง กับสถานีบริการน้ำมันสยามแก๊ส  เนื่องจากผู้ร้องแจ้งว่าบริเวณดังกล่าวมีสุนัขจรจัด (ไม่ทราบสายพันธุ์ และเพศ) ลักษณะสุนัขฯ ลายสีขาว สีน้ำตาล หางโค้ง จำนวน 1 ตัว ซึ่งพบว่าสุนัขจรจัดตัวดังกล่าวมักเดินอยู่ริมถนน มีพฤติกรรมดุร้าย ก้าวร้าว และไล่กัดประชาชน ตลอดเวลาที่เดินผ่าน และขี่รถจักรยานผ่าน (ไม่ระบุเวลาที่ชัดเจน) เป็นประจำทุกวัน ซึ่งเหตุการณ์ดังกล่าว ได้สร้างความเดือดร้อนให้แก่ผู้ร้องและประชาชนในพื้นที่ ประสบปัญหามาเป็นระยะเวลาประมาณ 1 เดือน ผู้ร้องจึงประสงค์ให้หน่วยงานที่เกี่ยวข้องช่วยเหลือนำสุนัขจรจัดออกจากพื้นที่ เพื่อบรรเทาความเดือดร้อน ให้แก่ผู้ร้องและประชาชนในพื้นที่ต่อไป (ผู้ร้องมีความประสงค์ให้ปกปิดชื่อ-นามสกุล และหมายเลขโทรศัพท์)
//หมายเหตุ ปักหมุดที่สำนักงานเขตเพราะไม่สามารถปักละติจูด ลองติจูดที่ชัดเจนได้ กรุณาอ่านรายละเอียดสถานที่จากรายละเอียดการแจ้งเป็นหลัก
//ศูนย์ฯ ประสานมาเพื่อตรวจสอบและดำเนินการและโปรดพิจารณาให้ความคุ้มครองผู้ร้องและผู้เกี่ยวข้องอย่าให้ต้องรับภัยหรือความไม่ชอบธรรมอันเนื่องมาจากการร้องเรียนการเป็นพยาน หรือการให้ข้อมูลนั้น #ศรท #ศรท1111
